import React, { Component } from 'react';
import './App.css';
import Parks from './Park/Park';
import data from './np_from_WIKI.json'

class App extends Component {
  state = {
    parks:[]
  }

  componentDidMount(){
    this.getParks();
  }

  getParks = () => {
    this.setState({parks:data["table"]});
  }

  renderParks = ({name, image}) => {
    return <Parks name={name} url={"http://" + image} />
  }
  render() {
    const {parks} = this.state;
    return (
      <div className="App">
        <div className="wrapper">{
          parks.map(this.renderParks)
        }
          </div>
      </div>
    );
  }
}

export default App;
